import React from "react";
import Header from "../Header/Header";
import Hero from "./Hero/Hero";
import Intro from "./Intro/Intro";
import Footer from "./Footer/Footer";

const App = () => {
  return (
    <div>
      <Header />
      <Hero />
      <Intro />
      <Footer />
    </div>
  );
};

export default App;
